package SmallestStringWithAGivenNumericValue

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

var tests = []struct {
	name     string
	n        int
	k        int
	expected string
}{
	// Example in Problem
	{"n=3 k=27 => aay", 3, 27, "aay"},
	{"n=5 k=73 => aay", 5, 73, "aaszz"},

	{"n=3 k=28 => aaz", 3, 28, "aaz"},
	{"more test", 3, 29, "abz"},
	{"more test", 5, 29, "aaaay"},

	// Test at edge
	{"more test", 1, 1, "a"}, // Min case
	// Max case
	{"more test", 10, 260, "zzzzzzzzzz"}, // Min case{"more test", 1, 1, "a"}, // Min case
	{"more test", 100000, 2600000, ""},
}

func TestSmallestStringWithAGivenNumericValue(t *testing.T) {
	for _, test := range tests {
		t.Run(test.name, func(subtest *testing.T) {
			// subtest.Parallel()
			actual := getSmallestString(test.n, test.k)
			assert.Equal(subtest, test.expected, actual)
		})
	}
}
